
def get_subject(url):
    try:
        if 'secondaire/' not in url:
            return None
        url = url[len('https://www.devoir.tn/'):]
        subjects = [
            ['anglais', ],
            ['arabe', ],
            ['economie', ],
            ['education-civique', ],
            ['education-Islamique', ],
            ['français', ],
            ['géographie', ],
            ['géstion', 'gestion'],
            ['histoire', ],
            ['informatique', ],
            ['mathématiques', ],
            ['sciences-SVT', ],
            ['physique', ],
            ['technologie', ],
            ['allemand', ],
            ['education-artistique', ],
            ['espagnol', ],
            ['italien', ],
            ['pensée-islamique', ],
            ['philosophie', ],
            ['algorithme-et-programmation', ],
            ['système-d’exploitation-et-réseaux-informatiques', ],
            ['tic', ],
            ['Bases-de-données', ],
            ['physique', ],
            ['Sport', ]
        ]
        for subject in subjects:
            if 1 in [1 if l in url.split('/')[3].lower() else 0 for l in subject]:
                return subject[0]

    except Exception as e:
        pass
    
    return None


